      address: row['주소'],
      teacher: JSON.parse(sessionStorage.getItem('teacher'))?.idx,
      pay_name: row['화폐이름'],
      role_code: null
    })).concat([
      {
        idnt_code: GenerateUUID(),
        student_name: '선생님',
        student_grade: null,
        student_class: null,
        mb_point: 0,
        student_number: 0,
        birth_date: null,
        gender: null,
        guardian_name: null,
        guardian_phone: null,
        address: null,
        teacher: JSON.parse(sessionStorage.getItem('teacher'))?.idx,
        pay_name: null,
        role_code: '1'
      },
      {
        idnt_code: GenerateUUID(),
        student_name: '관리자',
        student_grade: null,
        student_class: null,
        mb_point: 0,
        student_number: 0,
        birth_date: null,
        gender: null,
        guardian_name: null,
        guardian_phone: null,
        address: null,
        teacher: JSON.parse(sessionStorage.getItem('teacher'))?.idx,
        pay_name: null,
        role_code: '1'
      }
    ])

    console.log(students)


    // API 호출
    try {
      const res = await apiPost('teacher.php', {
        mode: 'studentInsert',
        data: students
      })

      if (res.result === 'SUCCESS') {
        alert('업로드 성공')
        window.location.reload()
      } else {
        alert(res.message || '업로드 실패')
      }
    } catch (error) {
      alert('서버 오류 발생')
      console.error(error)
    }
  }

  reader.readAsArrayBuffer(file)
}


